        "language" : "undefined",
        "value" : "A military support device that is designed to generate a diffused cloud or smoke screen on a battlefield in order to block or hinder the collection of information. Description: Obscurants of different kinds are used to block or hinder information-gathering in different modes and ranges. For example, covering an area with diffused smoke can impair human visual perception of activities in the area. In addition, carbon-fibre particles suspended in smoke may be used to absorb radar waves that would otherwise be used by homing devices on incoming missiles. Also, infrared (IR) obscurants may be used to counter thermal imagers (for example, those used to detect personnel moving over the ground). Obscurant devices include portable smoke canisters, pots, and barrels, and large smoke-generation machines that are attached to or towed by vehicles.",
