        "language" : "undefined",
        "value" : "An obstruction associated with a transportation route (for example: a road, a railway, a tunnel, or a bridge) to constrain, restrict, and/or prevent passage of vehicles.  Description: A permanent obstruction is fixed in place at a given location to continuously constrain traffic, and it is constructed such that it cannot be removed without major roadway excavation. A semi-permanent obstruction is placed at a given location so that traffic can be continuously constrained, but it is constructed such that it can be removed without major roadway excavation. A temporary, or non-permanent obstruction is placed at a given location to constrain traffic for a limited time only, and it is constructed such that it can be removed without major roadway excavation.",
