        "identifier" : "definition",
        "language" : "undefined",
        "value" : "A large and imposing house with many rooms, and often of architectural significance, which is located on a large rural estate.  Description: The term 'Manor House' covers a range of buildings from relatively modest rectories up to the largest and grandest country houses termed 'stately homes'. Titular names of manor houses frequently carry a suffix such as 'House', 'Manor(s)', 'Tower(s)', 'Hall', 'Park', 'Grange', 'Court', or 'Palace'. Historically, manor houses were residences for the landed gentry or the very wealthy. Although this still applicable today, many are used for different functions such as museums, hotels, amusement, hospitals, religious activities, and schools. A lack of fortification features distinguishes a manor house from a castle. The estate surrounding a manor house is typically at least several square kilometres in extent, often with a garden in the immediate vicinity of the house and a larger park beyond for aesthetic, recreational, and/or agricultural purposes.",
