        "language" : "undefined",
        "value" : "An EO-IR sensor that is an electronic sensing device sensitive to wavelengths that allow viewing of objects in extremely low light levels that would not be seen by the naked eye. Description: This kind of sensor is also known as low light level television. It is usually a charged coupled device camera. This sensor is sensitive to wave lengths above the normal \"visible\" (0.4 to 0.7 micrometres) wavelengths and into the short-wave Infrared (usually to about 1.0 to 1.1 micrometres). Television sensors are video camera devices that are designed for both day and night observation and surveillance. They are especially used in military activities, including surface target search and tracking, target location, navigation, and search and rescue functions on maritime vessels, manned rotary-winged aircraft, and unmanned aerial vehicles.",
