        "language" : "undefined",
        "value" : "An otherwise unspecified fixed structure which supports a maritime navigation light.  Description: These support structures may also be used to support other aids to maritime navigation (for example: maritime radiobeacons or fog signals). Older structures have been historically referred to as lighthouses, which traditionally would have housed a lighthouse keeper who lived within, or near, the lighthouse and worked on maintaining this navigational aid. Given modern day lighthouses, while the structure is the same, the lights are automated and maintained by the various government authorities who manage these aids.",
